CREATE TABLE customers(
   Number               INTEGER  NOT NULL PRIMARY KEY 
  ,Age                  INTEGER  NOT NULL
  ,Income               NUMERIC(11,5) NOT NULL
  ,Spending_Score       NUMERIC(11,6) NOT NULL
  ,Membership_Years     INTEGER  NOT NULL
  ,Purchase_Frequency   NUMERIC(11,9) NOT NULL
  ,Last_Purchase_Amount NUMERIC(11,6) NOT NULL
);
